import React, { useState } from 'react';
import { FileText, Grid, List, Filter, Search, Upload, MoreVertical } from 'lucide-react';
import DashboardLayout from '../components/layout/DashboardLayout';

const documents = [
  {
    id: 1,
    name: 'Investment Agreement',
    type: 'Contract',
    status: 'Active',
    lastModified: '2 hours ago',
    size: '2.4 MB',
  },
  {
    id: 2,
    name: 'Employment Contract',
    type: 'Contract',
    status: 'Draft',
    lastModified: '1 day ago',
    size: '1.8 MB',
  },
  {
    id: 3,
    name: 'NDA Template',
    type: 'Template',
    status: 'Active',
    lastModified: '3 days ago',
    size: '1.2 MB',
  },
  {
    id: 4,
    name: 'Privacy Policy',
    type: 'Policy',
    status: 'Active',
    lastModified: '1 week ago',
    size: '3.1 MB',
  },
  {
    id: 5,
    name: 'Terms of Service',
    type: 'Policy',
    status: 'Draft',
    lastModified: '2 weeks ago',
    size: '2.7 MB',
  },
];

const Documents = () => {
  const [viewMode, setViewMode] = useState('grid');
  const [searchQuery, setSearchQuery] = useState('');

  return (
    <DashboardLayout>
      <div className="flex flex-wrap justify-between gap-3 mb-8">
        <div className="flex min-w-72 flex-col gap-3">
          <h1 className="text-3xl font-bold text-gray-900">Documents</h1>
          <p className="text-gray-600">Manage and organize your legal documents</p>
        </div>
        <button className="flex items-center gap-2 px-4 py-2 bg-primary text-white rounded-lg hover:bg-primary/90 transition-colors">
          <Upload className="w-5 h-5" />
          <span>Upload Document</span>
        </button>
      </div>

      {/* Filters and Search */}
      <div className="bg-white rounded-xl border border-gray-200 p-4 mb-8">
        <div className="flex flex-wrap gap-4 items-center">
          <div className="flex-1 min-w-[300px]">
            <div className="relative">
              <input
                type="text"
                placeholder="Search documents..."
                value={searchQuery}
                onChange={(e) => setSearchQuery(e.target.value)}
                className="w-full pl-10 pr-4 py-2 rounded-lg border border-gray-200 focus:outline-none focus:ring-2 focus:ring-primary/20 focus:border-primary"
              />
              <Search className="w-5 h-5 text-gray-400 absolute left-3 top-1/2 transform -translate-y-1/2" />
            </div>
          </div>
          <button className="flex items-center gap-2 px-4 py-2 rounded-lg border border-gray-200 hover:bg-gray-50">
            <Filter className="w-5 h-5 text-gray-600" />
            <span>Filter</span>
          </button>
          <div className="flex items-center gap-2">
            <button
              onClick={() => setViewMode('grid')}
              className={`p-2 rounded-lg ${
                viewMode === 'grid'
                  ? 'bg-primary/10 text-primary'
                  : 'text-gray-600 hover:bg-gray-100'
              }`}
            >
              <Grid className="w-5 h-5" />
            </button>
            <button
              onClick={() => setViewMode('list')}
              className={`p-2 rounded-lg ${
                viewMode === 'list'
                  ? 'bg-primary/10 text-primary'
                  : 'text-gray-600 hover:bg-gray-100'
              }`}
            >
              <List className="w-5 h-5" />
            </button>
          </div>
        </div>
      </div>

      {/* Documents Grid/List */}
      <div className={viewMode === 'grid' ? 'grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6' : 'space-y-4'}>
        {documents.map((doc) => (
          <div
            key={doc.id}
            className={`bg-white rounded-xl border border-gray-200 overflow-hidden hover:shadow-lg transition-all ${
              viewMode === 'list' ? 'flex items-center justify-between p-4' : ''
            }`}
          >
            {viewMode === 'grid' ? (
              <div className="p-6">
                <div className="flex items-start justify-between mb-4">
                  <div className="w-12 h-12 rounded-lg bg-primary/10 flex items-center justify-center">
                    <FileText className="w-6 h-6 text-primary" />
                  </div>
                  <button className="p-2 rounded-lg hover:bg-gray-100">
                    <MoreVertical className="w-5 h-5 text-gray-600" />
                  </button>
                </div>
                <h3 className="text-lg font-semibold text-gray-900 mb-2">{doc.name}</h3>
                <div className="space-y-2">
                  <p className="text-sm text-gray-600">Type: {doc.type}</p>
                  <p className="text-sm text-gray-600">Size: {doc.size}</p>
                  <p className="text-sm text-gray-600">Modified: {doc.lastModified}</p>
                </div>
                <div className="mt-4">
                  <span
                    className={`inline-flex items-center px-3 py-1 rounded-full text-sm font-medium ${
                      doc.status === 'Active'
                        ? 'bg-green-100 text-green-800'
                        : 'bg-yellow-100 text-yellow-800'
                    }`}
                  >
                    {doc.status}
                  </span>
                </div>
              </div>
            ) : (
              <>
                <div className="flex items-center gap-4">
                  <div className="w-10 h-10 rounded-lg bg-primary/10 flex items-center justify-center">
                    <FileText className="w-5 h-5 text-primary" />
                  </div>
                  <div>
                    <h3 className="text-base font-medium text-gray-900">{doc.name}</h3>
                    <p className="text-sm text-gray-600">{doc.type} â€¢ {doc.size}</p>
                  </div>
                </div>
                <div className="flex items-center gap-4">
                  <p className="text-sm text-gray-600">{doc.lastModified}</p>
                  <span
                    className={`inline-flex items-center px-3 py-1 rounded-full text-sm font-medium ${
                      doc.status === 'Active'
                        ? 'bg-green-100 text-green-800'
                        : 'bg-yellow-100 text-yellow-800'
                    }`}
                  >
                    {doc.status}
                  </span>
                  <button className="p-2 rounded-lg hover:bg-gray-100">
                    <MoreVertical className="w-5 h-5 text-gray-600" />
                  </button>
                </div>
              </>
            )}
          </div>
        ))}
      </div>
    </DashboardLayout>
  );
};

export default Documents;
